import React from 'react';
import './header_edit.css'

const Headeredit = () => {
    return (
        <div className='header_edit_container'>
            <div className='edit_argent_bank_icon' ></div>
            <h1>Argent Bank</h1>
            <div className='user_icon' ></div>
            <div className='settings_icon' ></div>
            <div className='off_icon' ></div>
        </div>
    );
};

export default Headeredit;
